import PersistanceManager from "../../persistance/PersistanceManager";

class Pratiche {
    #id;
    #titolo;
    #descrizione;

    constructor (id, titolo, descrizione) {
        this.#id = id;
        this.#titolo = titolo;
        this.#descrizione = descrizione;
    }

    static async loadPratiche() {
        const ret = await PersistanceManager.doGet('loadPratiche.php?email=\'paolo@email.com\''); // da cambiare con l'email che è stata utilizzata per il login

        return ret;
    }

}

export default Pratiche;
